import pandas as pd
import ast
from shapely.geometry import Point
# reading the csv of map_matched results
map_matched = pd.read_csv("/Users/kad/Desktop/cyclists/Kimberley/mapmatching/osrm_caller/matched_tracks080125.csv")
# %%
#convert safetly
map_matched['track_id'] = map_matched['track_id'].apply(ast.literal_eval)
#create the empty dictionaries
matches = {
    "xy_tuple": [],
    "geometry":[]
}

#loop through the rows and catch the results in the dictionary
for idx, row in map_matched.iterrows(): 
    try:
        track_data = row["track_id"]

        x, y = track_data['location'][0], track_data['location'][1]

        # Append the relevant data to the matches dictionary
        matches['xy_tuple'].append((x, y))
        matches['roadname'].append(track_data['name'])
        matches['distance'].append(track_data['distance'])
        matches['geometry'].append(Point(x, y))

    except KeyError as e:
        print(f"Missing key: {e} in row {idx}")
    except Exception as e:
        print(f"An error occurred in row {idx}: {e}")

matches_df = pd.DataFrame(matches)

# Print the result
print(matches_df.head())


